import React from "react";

const ProductTable = ({ products, onDeleteProduct }) => {
  return (
    <table className="table">
      <thead>
        <tr>
          <th>Nombre</th>
          <th>Imagen</th>
          <th>Precio</th>
          <th>Stock</th>
          <th>Acciones</th>
        </tr>
      </thead>
      <tbody>
        {products.map((product) => (
          <tr key={product.id}>
            <td>{product.name}</td>
            <td>
              <img
                src={product.image}
                alt={product.name}
                style={{ maxWidth: "50px" }}
              />
            </td>
            <td>{product.precio}</td>
            <td>{product.stock}</td>
            <td>
              <button onClick={() => onDeleteProduct(product.id)}>
                Borrar
              </button>
              {/* Agregar botones de editar u otras acciones seg√∫n sea necesario */}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ProductTable;
